import React from "react";

const Book = ({ title, img, author }) => {
  return (
    <div className="container">
      <article className="book">
        <h1>{title}</h1>
        <img src={img} alt={title} />
        <h4>
          <span>Author :</span>
          {author}
        </h4>
      </article>
    </div>
  );
};

export default Book;
